    public static long countDistinctCharacters(String string) {
        // Convert the string to lowercase to ignore case differences
        string = string.toLowerCase();
        // Use a HashSet to store distinct characters
        Set<Character> distinctChars = new HashSet<>();
        // Iterate over each character in the string
        for (char c : string.toCharArray()) {
            // Add the character to the HashSet
            distinctChars.add(c);
        }
        // Return the size of the HashSet, which represents the number of distinct characters
        return (long) distinctChars.size();

