    // (new ArrayList<Long>(Arrays.asList()))
    public static ArrayList<Long> strangeSortList(ArrayList<Long> lst) {
        ArrayList<Long> sortedList = new ArrayList<Long>();
        while (!lst.isEmpty()) {
            // Add minimum value
            long min = Collections.min(lst);
            sortedList.add(min);
            lst.remove(new Long(min));
            // Add maximum value if exists
            if (!lst.isEmpty()) {
                long max = Collections.max(lst);
                sortedList.add(max);
                lst.remove(new Long(max));
            }
        }
        return sortedList;

