    public static boolean isNested(String string) {
        int balance = 0;
        boolean hasNested = false;
        for (char c : string.toCharArray()) {
            if (c == '[') {
                balance++;
            } else if (c == ']') {
                if (balance > 1) {
                    hasNested = true;
                }
                balance--;
            }
        }
        return hasNested;

