    // and return it in lowercase.
    // Restrictions: 1 <= num <= 1000
    // Examples:
    // >>> intToMiniRoman((19l))
    // ("xix")
    // >>> intToMiniRoman((152l))
    // ("clii")
    // >>> intToMiniRoman((426l))
    // ("cdxxvi")
    public static String intToMiniRoman(long number) {
        LinkedHashMap<Long, String> romanNumerals = new LinkedHashMap<>();
        romanNumerals.put(1000l, "m");
        romanNumerals.put(900l, "cm");
        romanNumerals.put(500l, "d");
        romanNumerals.put(400l, "cd");
        romanNumerals.put(100l, "c");
        romanNumerals.put(90l, "xc");
        romanNumerals.put(50l, "l");
        romanNumerals.put(40l, "xl");
        romanNumerals.put(10l, "x");
        romanNumerals.put(9l, "ix");
        romanNumerals.put(5l, "v");
        romanNumerals.put(4l, "iv");
        romanNumerals.put(1l, "i");
        StringBuilder roman = new StringBuilder();
        for (Map.Entry<Long, String> entry : romanNumerals.entrySet()) {
            while (number >= entry.getKey()) {
                roman.append(entry.getValue());
                number -= entry.getKey();
            }
        }
        return roman.toString();

